import React, { Component } from 'react';
import './App.css';

class App extends Component {

  state = {
    isLoaded: false,
    items: []
  } 

  componentDidMount() {
    fetch('./../user_roles')
      .then(res => res.json())
      .then(
        (result) => {
          this.setState({
            isLoaded: true,
            items: result.items
          }); 
        }
      )
  }


  render() {
    return (
      <div>
        <Header />
        <Form /> 
        <Roles />
      </div>
    );
  }
}

export default App;
